import numpy as np

class DataSet(object):
    def __init__(self, words, labels):
        assert words.shape[0] == labels.shape[0], ('words.shape: %s labels.shape: %s' % (words.shape, labels.shape))
        assert words.shape[3] == 1

        self._num_examples = words.shape[0]

        words = words.reshape(words.shape[0], words.shape[1] * words.shape[2])
        words = words.astype(np.float32)
        words = np.multiply(words, 1.0 / 255.0)

        self._words = words
        self._labels = labels
        self._epochs_completed = 0
        self._index_in_epoch = 0

    @property
    def words(self):
        return self._words

    @property
    def labels(self):
        return self._labels

    @property
    def num_examples(self):
        return self._num_examples

    @property
    def epochs_completed(self):
        return self._epochs_completed

    def next_batch(self, batch_size):
        start = self._index_in_epoch
        self._index_in_epoch += batch_size
        if self._index_in_epoch > self._num_examples:
            # Finished epoch
            self._epochs_completed += 1
            # Shuffle the data
            perm = np.arange(self._num_examples)
            np.random.shuffle(perm)
            self._words = self._words[perm]
            self._labels = self._labels[perm]
            # Start next epoch
            start = 0
            self._index_in_epoch = batch_size

            assert batch_size <= self._num_examples
        end = self._index_in_epoch
        return self._words[start:end]

def read_data_sets():
    class DataSets(object):
        pass

    train_words = words()
    train_labels = labels()

    return DataSet(train_words, train_labels)

